■LED液晶ディスプレイが発する光の中の青い部分「ブルーライト」を大幅にカットする液晶保護フィルムです。 ■※ブルーライトは目の角膜や水晶体で吸収されずに網膜まで到達し、網膜の機能低下を引き起こす場合があると言われています。 ■ブルーライトを効率的にカットするだけでなく、色調をできるだけ変えずに自然に見えるようフィルムを設計しています。 ■表面硬度3Hのハードコート加工により、フィルム表面のキズを防止します。 ■タッチパネルに対応しています。※但し、ディスプレイの個体差により対応できない場合があります。 ■台紙裏面が方眼台紙になっており、液晶サイズに合わせてキレイにカットすることができます ■自己吸着タイプの接着シリコン層なので、テープ不要で貼り付け可能です。簡単に貼り直しができ、貼り跡も無くきれいに剥がすことができます。 ■対応画面サイズ：15.6Wインチ ■紫外線カット機能：○ ■フィルターサイズ：幅344mm×高さ194mm ■取付方法：シリコン吸着 ■反射率：1.3%(MAX0.9%) ■可視光線透過率：86.9%(MAX92%) ■紫外線カット率：99%(MAX99.6%) ■フィルター厚み：0.145mm(他セパレートフィルム0.125mm) ■対応インチ：15.6W ■反射防止機能：○<!-- お気に入りボタン対応　start　-->
